import React from "react";
import "./TodoForm.css";

function TodoForm() {

    
    return (
        <form>
            <label onSubmit={(event) => {
                event.preventDefault();
            }}>Escribe tu nuevo TODO</label>
            <textarea 
            placeholder="Escribe tu nuevo TODO"
            />
            <div className="TodoForm-buttonContainer">
                <button 
                type="submit"
                 className="TodoForm-button--cancel">Cancelar</button>
                <button
                 className="TodoForm-button--add">Agregar</button>
            </div>
          
        </form>    
    );
}

export { TodoForm };
